    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Crescent Lake NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Crescent Lake NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, an overview of the CCP process, a summary of Refuge
    resources, Refuge goals and objectives, and implementation and monitoring strategies.
    Key planning issues include: wilderness proposals, endangered species, public access,
    hunting, fishing, invasive species, bison reintroduction, lands of interest, staffing,
    and funding.",nt"license_title": "License Not Specified",nt"extras":
